import React from 'react';
import { StyleSheet, Text, SafeAreaView, DefaultTheme } from 'react-native';

import Navigation from "./src/navigation"

const MyTheme = {
  ...DefaultTheme,
  colors: {
    ...DefaultTheme.colors,
    background: "red",
  },
};

const App = () => {
  return (
    <SafeAreaView style={styles.root}>
      <Navigation />
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  root: {
    flex: 1, 
    backgroundColor: "#f5b7b1",  
  },
});

export default App;
